import React from 'react'
import Logo from "../../logo.png";
import LogoRed from "../../logo-red.png";

const HomePage = () => {
    state = {
        image : Logo
    }
    return (
        <div className="d-flex justify-content-center align-items-center">
            <img className="w-50 ml-auto mr-auto" src={this.state.image} 
            onMouseOver
            =
            {this.setState({
                image:LogoRed
            })} 
            onMouseOut={
                this.setState({
                    image:Logo
                })
            }></img>
        </div>
    )
}

export default HomePage
